def patternPos(text, pattern):
    poses=[]
    for i in range (0, len(text)-len(pattern)+1):
        if text[i] == pattern[0]:
            for j in range (1, len(pattern)):
                if text[i+j]==pattern[j]:
                    if j==len(pattern)-1:
                        poses.append(i)
                else:
                    break
    return poses

def patternCount(text, pattern):
    count = 0
    for i in range (0, len(text)-len(pattern)+1):
        if text[i] == pattern[0]:
            for j in range (1, len(pattern)):
                if text[i+j]==pattern[j]:
                    if j==len(pattern)-1:
                        count+=1
                else:
                    break
    return count

def frequentWords(text, k):
    """returns dict[most frequnt strings of given length k:count of occurances in text]"""
    patterns ={}
    mostFreq={}
    count=0
    maxCount=0
    for i in range (0, len(text)-k):
        patternI=""
        for j in range (0, k):
            patternI+=text[j+i]
        count=(patternCount(text, patternI))
        if count >= maxCount:
            patterns[patternI]=count
            maxCount=count
    for key in patterns:
        if patterns[key] == maxCount:
            mostFreq[key]=patterns[key]
    for key in mostFreq:
        print (key)
    return mostFreq


def reverseComplement(dna):
    rev=""
    for letter in dna:
        if letter == "A":
            rev="T"+rev
        elif letter == "C":
            rev="G"+rev
        elif letter == "T":
            rev="A"+rev
        elif letter == "G":
            rev="C"+rev
    return rev
        
    
